import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    message : []
  },
  mutations: {
    saver (sentmessage) {
      message.push(sentmessage)
    }
  },
  actions: {

  }
})
